css:
@-moz-document url("https://rubyrealms.com") {
.head {
    height: 52px;
    box-shadow: 0px 1px 2px rgba(164, 203, 226, 0.6);
    position: fixed;
    top: 0;
    width: 100%;
    z-index: 1000;
}


.background-header {
    background-color: #cbe6e6 !important;
}

.background-button {
    background-color: #91c9cc !important;
}

.background-menu {
    background-color: #b0deff !important;
}

.background-container {
    background-color: #455e8e !important;
}

.color-primary-3 {
    color: #0b2688 !important;
}
}
